class App extends React.Component {
  state = {
    count: 0
  };

  plus = () => {
    console.log("+");
  };
  minus = () => {
    console.log("-")
  };

  render() {
    return (<div>
      <h1>The number is {this.state.count}</h1>
      <button>Plus</button>
      <button>Minus</button>
    </div>);
  }
}

export default App;
